import "./App.css";
import Data from "./components/Data";

function App() {
  return (
    <div class="row mt-80 justify-content-center">
      <div class="col-md-6">
          {Data.map((value) => {
            return (
              <ul>
                <li><button></button></li>
                <li></li>
                <li></li>
              </ul>
            );
          })}
      </div>
      <div class="col-md-6">
        <table class="table table-dark table-hover">
          <thead>
            <tr>
              <th scope="col">Title</th>
              <th scope="col">Genre</th>
              <th scope="col">Stock</th>
              <th scope="col">Rate</th>
              <th scope="col"> </th>
            </tr>
          </thead>

          <tbody>
            {Data.map((index) => {
              return (
                <>
                  <tr>
                    <td key="{index.title}">{index.title}</td>
                    <td>{index.genre}</td>
                    <td>{index.stock}</td>
                    <td>{index.rate}</td>
                    <td>
                      <button>Delete</button>
                    </td>
                  </tr>
                </>
              );
            })}
            ;
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default App;
